import './App.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom'



ReactDOM.render(
  <React.StrictMode>
     <BrowserRouter>
    <App />
  </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
